import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { useState } from "react";
import SlideTwo from "./SlideTwo";
import FinalSlide from "./FinalSlide";

function SlideShow() {
  return (
    <div className="Container">
      <div className="card w-75 mx-auto mt-6" style={{ height: "700px" }}>
        <div className="text-center mt-5">
          <h2>Testing</h2>
        </div>
        <div className="header text-center mt-4">i am there</div>
        <div className="Container">
          <div className="row justify-content-around py-5">
            <div className="col-xxl-6 col-xl-6">
              <img src="/Testing/Test1_Tumor.jpg" className="img-fluid"></img>
              <div className="d-flex justify-content-center mt-3">
                <input type="radio" className="ms-3" name="" value=""></input>
              </div>
            </div>
            <div className="col-xxl-5 col-xl-6">
              <img src="/Testing/Test1_No_Tumor.jpg" className="img-fluid"></img>
              <div className="d-flex justify-content-center mt-3">
                <input type="radio" className="ms-3" name="" value=""></input>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default SlideShow;
